import React from "react";
import "./Header.css";
function Header() {
  return (
    <div className="header">
      <img className="header__logo" src="" />

      <div className="header__nav">
        <div className="header__option">
         <span className="header__optionLineOne"> 
         Hello Haris
         </span>
        </div>
        <div className="header__option">
            
        </div>
      </div>
    </div>
  );
}

export default Header;
